import React from 'react';

const ErrorPage = () => {
  return (
    <div>
      <h1>Error</h1>
      <p>An error has occurred.</p>
    </div>
  );
};

const Navigation = () => {
  return (
    <nav>
      <ul>
        <li><a href="/">Home</a></li>
        <li><a href="/about">About</a></li>
        <li><a href="/contact">Contact</a></li>
      </ul>
    </nav>
  );
};

const App = () => {
  const [error, setError] = React.useState(false);

  return (
    <div>
      { error ? <ErrorPage /> : <Navigation /> }
    </div>
  );
};
